import { Typography, Box, Container } from "@mui/material";
import React from "react";

export const Hero = () => {
    return (
        <Container sx={{width: "100vw"}}>
            <Typography variant="h6" sx>Our Rooms</Typography>
            <Box>
              <img src="https://images.pexels.com/photos/189333/pexels-photo-189333.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="" />
            </Box>
        </Container>
    );
};
